import React from 'react'

export const Navbar = () => {
    return (
        <div className="navbar navbar-dark bg-dark mb-4">

            <span className="navbar-brand"> Peter Parker </span>

            <button className="btn btn-outline-danger mx-3 px-4">
                <span> Salir </span>
            </button>

        </div>
    )
}
